import React, { useContext } from "react";
import { UniversalContext } from "./App";
import ProjectListItem from "./ProjectListItem";
import Footer from "./Footer";

function ProjectList() {
  const projectContext = useContext(UniversalContext);
  console.log("project context", projectContext.projects);
  const data = projectContext.projects;
  console.log("data from projectlist", data.feed);
  let renderProjects = this;

  if (data.feed) {
    renderProjects = data.feed.entry.map((project, index) => {
      console.log("hope this works", data.feed.entry);
      return (
        <div className="allProjects">
          <div className="project-squares" key={index}>
            <p>{project.gsx$title.$t}</p>
            <p className="image"><img src ={project.gsx$image.$t}></img></p>
            <p>{project.gsx$description.$t}</p>
            <p>
              <a href className={project.gsx$url.$t}></a>
            </p>
          </div>
        </div>
      );
    });
    console.log("project", renderProjects);

    //   )
  }
  return <div className="haha"><div className="cookies">{renderProjects}</div><Footer /></div>;

  // console.log('render',renderProjects)
}
export default ProjectList;
